function tableSet(pua) {
    $(".tr").remove();
    pua.forEach(function(line) {
        var tr = '';
        Object.keys(line).forEach(function(key) {
            var classname = '';
            tr += "<td class='" + classname + "'>" + line[key] + "</td>";
        });
        $('#table').append("<tr class='tr'>" + tr + "</tr>");
    });
}
document.addEventListener('DOMContentLoaded', function() {
    tableSet(pua);
});